window.bookSummaryJSON = "<p>Jacqueline Carey is the <i>New York Times</i> best-selling author of the award-winning Kushiel's Legacy series. Dark Currents introduces Daisy Johanssen, a hell-spawn living in a Mid-west resort town that also boasts fairies, vampires, and a Norse goddess. As police department liaison for the paranormal, Daisy takes notice when a drowning victim shows signs of eldritch involvement. Paired with officer - and werewolf - Cody Fairfax, she must solve the case before tourist season is ruined.</p>"; 
